// --- INÍCIO DO CÓDIGO CORRIGIDO E MELHORADO ---

const body = $input.first().json.body;

// Mapa para traduzir as áreas de interesse (chaves) para seus nomes completos (valores)
const interessesMap = {
  'exp-elm': 'Projeto Eletromecânico',
  'exp-spcs': 'Projeto de SPCS',
  'exp-cv': 'Projeto Civil',
  'exp-scada': 'Supervisórios (Sage, Elipse, WinCC, etc)',
  'exp-param': 'Parametrização de Relés ou CLPs',
  'exp-test': 'Testes e Comissionamento',
  'exp-est': 'Estudos Elétricos',
  'exp-bim': 'BIM',
  'exp-prog': 'Programação',
  'exp-red': 'Redes e Protocolos (TCP/IP, DNP3, MMS, Goose)',
  'exp-tel': 'Telecomunicações (SDH, PDH, OPLAT, MPLS, Wireless, CFTV)',
  'exp-ciber': 'Cibersegurança',
  'exp-ti': 'Tecnologia da Informação',
  'exp-data': 'Ciência de Dados',
  'exp-ia': 'Inteligência Artificial',
  'exp-com': 'Comercial',
  'exp-fin': 'Financeiro',
  'exp-cont': 'Contábil',
  'exp-rh': 'Recursos Humanos',
  'exp-ge': 'Gestão de Pessoas',
  'exp-gp': 'Gerência de Projetos'
};

// Função para normalizar texto em Title Case
function normalizeText(text) {
  if (!text || typeof text !== 'string') return '';
  const prepositions = ['de', 'da', 'do', 'das', 'dos', 'e'];
  return text.toLowerCase().split(' ').map((word, index) => {
    if (index > 0 && prepositions.includes(word)) return word;
    return word.charAt(0).toUpperCase() + word.slice(1);
  }).join(' ');
}

// Converte escolhas binárias em "Sim" ou "Não"
function normalizeChoice(value) {
  if (!value || typeof value !== 'string') return '';
  const lower = value.toLowerCase();
  if (lower.includes('yes')) return 'Sim';
  if (lower.includes('no')) return 'Não';
  return '';
}

// Função mantida para processar outras listas
function processAndJoinList(rawData, prefixToRemove) {
  if (!rawData) return '';
  const arr = Array.isArray(rawData) ? rawData : [rawData];
  return arr.map(item => normalizeText(item.replace(prefixToRemove,'').replace(/-/g,' '))).join(', ');
}

// ATUALIZADO: Função agora lida com strings separadas por vírgula
function mapAndJoinList(rawData, map) {
  if (!rawData) return '';

  let arr = [];
  // Verifica se o dado é uma string e a divide em um array.
  // Se já for um array, usa-o diretamente.
  if (typeof rawData === 'string') {
    arr = rawData.split(',');
  } else if (Array.isArray(rawData)) {
    arr = rawData;
  } else {
    // Se não for nenhum dos dois, retorna uma string vazia para evitar erros
    return '';
  }

  return arr.map(item => {
    // Garante que o item é uma string e remove espaços extras
    const cleanItem = typeof item === 'string' ? item.trim() : '';
    // Busca o item "limpo" no mapa. Se não encontrar, retorna o próprio item como fallback.
    return map[cleanItem] || item; 
  }).join(', ');
}

// Função para gerar rótulo personalizado de link
function getLinkLabel(link, index) {
  if (!link) return '';
  const lower = link.toLowerCase();
  if (lower.includes('linkedin.com')) return 'LinkedIn';
  if (lower.includes('github.com')) return 'GitHub';
  if (lower.includes('openai.com')) return 'OpenAI';
  if (lower.includes('twitter.com')) return 'Twitter';
  if (lower.includes('facebook.com')) return 'Facebook';
  return `Link ${index + 1}`;
}

// --- EXTRAÇÃO E TRANSFORMAÇÃO DOS DADOS ---

const firstName = body['mf-first-name'] || '';
const lastName = body['mf-last-name'] || '';
const nomeCompleto = normalizeText(`${firstName} ${lastName}`.trim());

// Esta linha agora usará a função corrigida que lida com a string
const interesses = mapAndJoinList(body['mf-experience'], interessesMap);
const areaFormacao = processAndJoinList(body['mf-degree'], 'area-');

// Lista de links
const links = [
  body['mf-url-1'],
  body['mf-url-2'],
  body['mf-url-3']
].filter(Boolean);

// Criação da célula final de links
let linksFormula = '';
if (links.length === 1) {
  linksFormula = `=HYPERLINK("${links[0]}"; "${getLinkLabel(links[0],0)}")`;
} else if (links.length > 1) {
  linksFormula = links.join('\n');
}

// --- MONTAGEM DO OBJETO FINAL ---
const resultado = {
  nomeCompleto: nomeCompleto,
  dataNascimento: body['mf-date-of-birth'] || '',
  telefone: body['mf-phone'] || '',
  email: body['mf-email'] || '',
  cidade: normalizeText(body['mf-city']),
  estado: (body['mf-state'] || '').toUpperCase(),
  disponibilidadeViagem: normalizeChoice(body['mf-trip']),
  setorEletrico: normalizeChoice(body['mf-channel']),
  areaFormacao: areaFormacao,
  interesses: interesses, // Com o código novo, o resultado aqui será "Programação, Ciência de Dados, Inteligência Artificial"
  link1: body['mf-url-1'] || '',
  link2: body['mf-url-2'] || '',
  link3: body['mf-url-3'] || '',
  linksFormula: linksFormula,
  cnh: (body['mf-cnh'] || '').replace('cnh-', '').toUpperCase(),
  vagaInscrita: body['mf-vaga'] || '',
  curriculo_url: body['curriculo_url']
};

return [resultado];

// --- FIM DO CÓDIGO ---
